@media (max-width:1237px) {
  #id_n {
    white-space: nowrap;
    overflow: hidden;
    text-overflow: ellipsis;
    max-width: 100px;
    display: inline-block;
  }
}

.rwds_svg {
  vertical-align: top;
  display: inline-block;
}

.rwds_svg.mobile {
  float: left;
}

.rwds_svg.serp {
  margin: 8px 0 0 8px;
}

.rwds_svg.serp.mobile {
  margin: 8px 4px 0 8px;
}

.rwds_svg.hp {
  margin: 5px 4px 0 8px;
}

.rwds_svg.hp.mobile {
  margin: 5px 4px 0 10px;
}

.rhlined,
.rhfill {
  vertical-align: top;
  width: 32px;
  height: 32px;
}

#id_rh {
  position: relative;
}

.rhcoinflip {
  vertical-align: top;
  width: 60px;
  height: 60px;
  position: absolute;
  right: -6px;
  top: -6px;
}

#idCont .rhcoinflip {
  position: absolute;
  right: -5px;
  top: -9px;
}

#rh_meter {
  vertical-align: top;
  width: 40px;
  height: 40px;
  margin-left: -36px;
  margin-top: -4px;
}

.rh_reedm .rhlined,
.rhfill,
.rh_reedm .meter {
  display: none;
}

.rhlined,
.rh_reedm .rhfill,
#rh_meter {
  display: inline-block;
}

.rd_hide {
  visibility: hidden;
}

.rhlined.hp .meter,
.rhfill.hp .meter {
  stroke: rgba(255,255,255,.4);
}

.noBg .rhlined.hp .meter,
.noBg .rhfill.hp .meter,
.rhlined.serp .meter,
.rhfill.serp .meter {
  stroke: rgba(177,177,177,.4);
}

.rhlined.hp .medal,
.rhfill.hp .medal {
  fill: white;
}

.noBg .rhlined.hp .medal,
.rhlined.serp .medal {
  fill: #919191;
}

.noBg .rh_reedm .rhfill.hp .medal,
.rh_reedm .rhfill.serp .medal {
  fill: #00809d;
}

#rh_animcrcl {
  fill: none;
  stroke: transparent;
  stroke-width: 0;
}

#rh_animcrcl.anim {
  stroke-width: 2;
}

#rh_animcrcl.anim.hp {
  stroke: white;
}

@media screen and (-ms-high-contrast:black-on-white) {
  .rhlined.hp .medal,
  .rhfill.hp .medal {
    fill: black;
  }

  #rh_animcrcl.anim.hp {
    stroke: black;
  }
}

#rh_animcrcl.serp.anim {
  stroke: #00809d;
}

#rh_animpath.serp.anim {
  fill: #00809d;
}

.noBg #rh_animcrcl.anim.hp {
  stroke: #00809d;
}

.rh_scale .rhfill,
.rh_scale #rh_meter {
  animation: scaling .4s cubic-bezier(.3,.55,.1,1);
}

@-webkit-keyframes scaling {
  0% {
    transform: scale(1,1);
  }

  50% {
    transform: scale(1.3,1.3);
  }

  100% {
    transform: scale(1,1);
  }
}

@keyframes scaling {
  0% {
    transform: scale(1,1);
  }

  50% {
    transform: scale(1.3,1.3);
  }

  100% {
    transform: scale(1,1);
  }
}

#tallhead #idMobileCont {
  position: absolute;
}

#tallhead #idMobileCont>* {
  top: 3px;
}

#idMobileCont>* {
  vertical-align: top;
  display: inline-block;
