.img_cont {
  background-position: center;
  background-size: cover;
  bottom: 0;
  right: 0;
  left: 0;
  top: 0;
  position: fixed;
}

.img_cont .img_uhd {
  opacity: 0;
  background-size: cover;
  background-position: center;
  bottom: 0;
  right: 0;
  left: 0;
  top: 0;
  position: absolute;
}

.img_cont .bg_video {
  object-fit: cover;
