}

@media screen and (min-width:2240px) {
  .hp_cont {
    width: 1792px;
  }
}

.dimmer {
  position: fixed;
  width: 100%;
  height: 100%;
  left: 0;
  top: 0;
  pointer-events: none;
  transition: background-color .2s;
}

.dimmer.dim {
  z-index: 2;
  pointer-events: all;
  background-color: rgba(0,0,0,.6);
}

.shaders {
  position: fixed;
  height: 100%;
  width: 100%;
  left: 0;
  top: 0;
}

.shaders .topLeft,
.shaders .topRight,
.shaders .bottom {
  height: 28%;
  position: absolute;
}

.shaders .topLeft {
  left: 0;
  width: 100%;
  background: linear-gradient(to bottom left,rgba(0,0,0,.5) -20%,transparent 30%);
}

.shaders .topRight {
  right: 0;
  width: 100%;
  background: linear-gradient(to bottom right,rgba(0,0,0,.5) -20%,transparent 30%);
}

.shaders .bottom {
  background: linear-gradient(to bottom,transparent 0%,rgba(0,0,0,.6) 100%);
  bottom: 0;
  left: 0;
  width: 100%;
}

.sbox {
  width: 78%;
  box-sizing: border-box;
  min-height: 40px;
  max-height: 52px;
  height: 100%;
  min-width: 580px;
  max-width: 596px;
  white-space: nowrap;
  top: 15%;
  position: relative;
  z-index: 2;
  margin: 0 0 0 228px;
}

.sbox * {
  box-sizing: inherit;
}

.sbox.fix {
  top: 40px !important;
  transform: none !important;
}

.sbox .logo,
.sbox .sb_form {
  display: inline-block;
  vertical-align: middle;
}

.sbox .logo {
  width: 20%;
  height: 100%;
}

.sbox .logo svg {
  height: 100%;
  width: 100%;
}

.sbox .sb_form {
  width: 100%;
  background-color: transparent;
  font: normal 1rem "Segoe UI",Arial,Helvetica,Sans-Serif;
  padding-right: 10px;
  box-shadow: 0 2px 4px rgba(0,0,0,.3);
  align-items: center;
  justify-content: flex-end;
  display: inline-flex;
  border-radius: 6px;
  height: 100%;
  position: relative;
  background-color: #fff;
}

.sbox .sb_form svg {
  height: 100%;
  width: 100%;
}

.sbox .sb_form input[type=search]::-ms-clear,
.sbox .sb_form input[type=search]::-ms-reveal {
  display: none;
  width: 0;
  height: 0;
}

.sbox .sb_form .sb_form_q {
  background-color: transparent;
  padding: 12px 10px;
  flex: 1;
  border: 0;
  outline: none;
  -webkit-appearance: none;
  font-size: 1.125rem;
  font: inherit;
}

.sbox .sb_form .sb_form_q:focus~#sw_as,
.sbox .sb_form .sb_form_q:active~#sw_as {
  display: block;
}

.sbox .sb_form .sb_form_q:focus~#sw_as .sa_as,
.sbox .sb_form .sb_form_q:active~#sw_as .sa_as {
  display: block;
}

.sbox .sb_form .icon {
  position: relative;
  min-width: 28px;
  margin: auto 4px;
  height: 45%;
  width: 5%;
}

.sbox .sb_form #vkeyIcon {
  width: 100%;
  height: 100%;
}

.sbox .sb_form .search,
.sbox .sb_form #vkeyIcon {
  cursor: pointer;
}

.sbox .sb_form #sb_form_go {
  padding: 0;
  height: 0;
  width: 0;
  outline: none;
  border: none;
  position: absolute;
}

.sbox .sb_form #sb_form_go:focus {
  outline: -webkit-focus-ring-color auto 1px;
  width: 35px;
  height: 27px;
  background-color: transparent;
}

.sbox .sb_form #sw_as {
  left: 0;
  height: auto;
  right: 10px;
  top: 100%;
  position: absolute;
  padding-top: 8px;
  margin-top: -8px;
  display: none;
  box-sizing: content-box;
}

.sbox .sb_form #sw_as .sa_as {
  position: relative;
  display: none;
}

.sbox .sb_form #sw_as .sa_as.sa_nw:not(:empty) {
  margin-left: 0;
  width: initial;
}

.sbox .sb_form #sw_as .sa_as.sa_nw:not(:empty) .sa_drw:not(:empty) {
  margin-top: 0;
}

.sbox .sb_form #sw_as .sa_as.sa_nw {
  position: absolute;
}

.sbox .sb_form #sw_as .sa_as .sa_drw {
  overflow: hidden;
  border-radius: 0 0 6px 6px;
  background-color: #fff;
}

.sbox .sb_form #sw_as .sa_as .sa_drw:not(:empty) {
  border-top: 1px solid rgba(0,0,0,.2);
  overflow: hidden;
}

.sbox .sb_form #sw_as .sa_as .sa_drw:not(:empty):before {
  width: 100%;
  height: 8px;
  top: -8px;
  position: absolute;
  background-color: #fff;
  content: '';
}

.sbox .sb_form #sw_as .sa_as .sa_drw li,
.sbox .sb_form #sw_as .sa_as .sa_drw .nowrap {
  white-space: nowrap;
}

.sbox .sb_form #sw_as .sa_as .sa_drw .sa_hd {
  margin-left: 17px;
  font-size: .6875rem;
  line-height: 16px;
}

.sbox .sb_form #sw_as .sa_as .sa_drw .sa_sg {
  cursor: pointer;
}

.sbox .sb_form #sw_as .sa_as .sa_drw .sa_sg .sa_tm {
  margin-left: 17px;
  line-height: 36px;
}

.sbox .sb_form #sw_as .sa_as .sa_drw .pp_title {
  color: inherit;
}

.sbox .sb_form input[type='search']::-webkit-search-decoration,
.sbox .sb_form input[type='search']::-webkit-search-cancel-button,
.sbox .sb_form input[type='search']::-webkit-search-results-button,
.sbox .sb_form input[type='search']::-webkit-search-results-decoration {
  display: none;
}

.sbox .sb_bpr {
  font-size: .8125rem;
  color: #767676;
}

