}

.sbiIdc {
  transform: rotate(45deg);
  display: block;
  width: 14px;
  height: 14px;
  background: #fff;
  margin-top: -27px;
  border: 1px solid #f5f5f5;
  border-bottom: transparent;
  border-right: transparent;
  left: 354px;
  position: absolute;
  z-index: -1;
}

.sbiclsbtn {
  position: absolute;
  right: 20px;
  top: 20px;
  cursor: pointer;
  z-index: 1;
}

.sbiclsbtn img {
  width: 12px;
}

.sbidialog[mode="camera"] .sbiclsbtn img {
  width: 16px;
}

.sbitit {
  font-size: 20px;
  font-family: 'Segoe UI',Arial,Helvetica,Sans-Serif;
  line-height: 24px;
  color: #111;
  text-align: center;
  margin-bottom: 6px;
}

.sbisubtit {
  text-align: center;
}

.normalzone {
  margin-top: 20px;
  position: relative;
}

.pastearea,
.photopn {
  width: 182px;
  height: 40px;
  display: inline-block;
  background: #f9f9f9;
  border: 1px solid #ddd;
  line-height: 40px;
  vertical-align: middle;
  text-align: center;
  cursor: pointer;
  border-radius: 4px;
}

.pastearea[psting] .pstpn {
  display: none;
}

.sbidialog[nowebcam] .pastearea {
  width: 378px;
}

input.imgpst {
  width: 100%;
  border: none;
  height: 40px;
  padding: 0 12px;
  box-sizing: border-box;
  display: none;
}

.pastearea[psting] input.imgpst {
  display: block;
}

.photopn {
  position: absolute;
  right: 0;
}

.sbidialog .psticon,
.sbidialog .tpicon {
  margin-right: 8px;
  vertical-align: -4px;
}

.dropzone {
  background-color: #f9f9f9;
  height: 100px;
  vertical-align: middle;
  text-align: center;
  margin-top: 12px;
  position: relative;
  background-image: linear-gradient(to right,#ddd 60%,transparent 40%),linear-gradient(to right,#ddd 60%,transparent 40%),linear-gradient(to bottom,#ddd 60%,transparent 40%),linear-gradient(to bottom,#ddd 60%,transparent 40%);
  background-position: left top,left bottom,left top,right top;
  background-repeat: repeat-x,repeat-x,repeat-y,repeat-y;
  border-radius: 4px;
  background-size: 12px 1px,12px 1px,1px 12px,1px 12px;
}

.dpnmpn .dpicon,
.dpnmpn .rms_iac {
  margin-top: 26px;
}

.sbidialog[nowebcam] .photopn,
.sbidialog[dropping] .normalzone,
.sbidialog[dropping] .dpnmpn {
  display: none;
}

.sbidialog[dropping] .dpintext {
  display: inline-block;
}

.sbidialog[dropping] .dropzone {
  padding: 27px 0;
  background-color: #f5f5f5;
  margin-top: 20px;
}

.sbidialog[nowebcam] .photopn,
.sbidialog[loading] .normalzone,
.sbidialog[loading] .dpnmpn,
.sbidialog[loading] .dpintext,
.sbidialog[loading] .sbiDemos,
.sbidialog[loading] .sbiFooter {
  display: none;
}

.sbidialog[loading] .dropzone {
  padding: 27px 0;
  background-color: #f5f5f5;
  margin-top: 20px;
}

.sbidialog[loading] .dpload {
  display: inline-block;
}

.loadingdiv {
  position: relative;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  display: none;
}

.sbidialog[loading] .loadingdiv {
  display: inline-block;
}

.loadingdiv #loadingimg {
  position: relative;
  margin: auto;
  width: 50px;
  height: 50px;
}

.brtext {
  color: #007daa;
  margin-left: 4px;
  cursor: pointer;
  font-weight: 600;
}

.dpintext {
  display: none;
  font-size: 24px;
  color: #919191;
  font-family: 'Segoe UI',Arial,Helvetica,Sans-Serif;
  font-weight: 300;
  line-height: 100px;
}

.dpload {
  display: none;
  font-size: 24px;
  color: #919191;
  line-height: 100px;
}

.fileinput {
  display: none;
}

.actpn {
  border-top: 1px solid #ddd;
  height: 45px;
  color: #007daa;
  background: #f9f9f9;
  line-height: 45px;
  left: 0;
  right: 0;
  bottom: 0;
  margin: 20px -20px -20px;
  padding: 0 20px;
  border-radius: 0 0 4px 4px;
}

.sbi_lmlnkc {
  margin: 10px 0 -4px;
}

a#sb_sbi_lmlnk {
  color: #001ba0;
}

.camcontent {
  margin: -20px;
}

.cammsgp {
  position: absolute;
  bottom: 58px;
  width: 100%;
  display: none;
}

.cammsg {
  width: 170px;
  padding: 12px;
  background: #222;
  border-radius: 4px;
  color: #fff;
  text-align: center;
  margin: auto;
}

.cambtn {
  cursor: pointer;
  width: 30px;
  height: 30px;
  padding: 8px;
  margin: auto;
}

.cambtncirclelarge {
  width: 30px;
  height: 30px;
  border-radius: 15px;
  background: #007daa;
  opacity: .4;
}

.cambtncirclesmall {
  width: 20px;
  height: 20px;
  border-radius: 10px;
  background: #007daa;
  opacity: 1;
  position: relative;
  top: -25px;
  left: 5px;
}

.webvideo {
  display: block;
  background-color: #000;
  width: 100%;
  height: auto;
  border-radius: 4px 4px 0 0;
  transition: height 1s;
}

.camcontent[disabled] .cammsgp {
  display: block;
}

.camcontent[disabled] .cambtn {
  pointer-events: none;
}

.camcontent[disabled] .cambtncirclelarge {
  background: #cecece;
}

.camcontent[disabled] .cambtncirclesmall {
  background: #f7f7f7;
}

.sbidialog[mode="normal"] .camcontent,
.sbidialog[mode="normal"] .clsoptbtnimg,
.sbidialog[mode="camera"] .sbiopc,
.sbidialog[mode="camera"] .clsbtnimg,
.sbidialog[mode="camera"] .sbiinfbtn {
  display: none;
}

.sbi_form,
.sbi_form_ph,
.sbi_dmlnk {
  display: none;
}

#sbi_searchbox_input::-webkit-input-placeholder {
  color: #444;
}

#sbi_searchbox_input::-moz-placeholder {
  color: #444;
}

#sbi_searchbox_input:-moz-placeholder {
  color: #444;
}

#sbi_searchbox_input:-ms-input-placeholder {
  color: #444;
}

.sbifre .sbitit {
  color: #444;
  margin-bottom: 8px;
}

.sbifre .sbisubtit {
  color: #666;
