}

.sbifre .dpnmpn .dpicon,
.sbifre .dpnmpn .rms_iac {
  margin: 12px 8px;
  vertical-align: middle;
  height: 16px;
  width: 16px;
}

.sbifre .sbisep {
  position: relative;
  height: 18px;
  text-align: center;
  margin: 6px 0;
}

.sbifre .sbisepln {
  display: block;
  position: absolute;
  width: 90%;
  margin: 0 5%;
  height: 1px;
  background: #ececec;
