}

.sbifre .sbi_lmlnkc {
  margin: -4px 0 -8px;
}

.sbifre .sbiinfbtn {
  position: absolute;
  right: 8px;
  top: 8px;
}

.sbifre.sbidialog[dropping] .sbiDemos,
.sbifre.sbidialog[dropping] .sbiBanner,
.sbifre.sbidialog[dropping] .sbiFooter {
  display: none;
}

.sbifre.sbidialog[nowebcam] .pastearea {
  width: 354px;
}

.sbifre a#sb_sbi_lmlnk {
  color: #007daa;
  font-weight: 600;
}

@media screen and (max-height:785px) {
  #sbox .sbifre .sbiDemos,
  #c_srch #sbicom .sbifre .sbiDemos {
    display: none;
  }

  #sbox .sbifre .sbiFooter,
  #c_srch #sbicom .sbifre .sbiFooter {
    margin-top: 20px;
  }
}

@media screen and (max-height:600px) {
  #sb_sbipane .sbiDemos {
    display: none;
  }

  #sb_sbipane .sbiFooter {
    margin-top: 20px;
  }
}

.sbiinfbtn {
  position: absolute;
  right: 44px;
}

.infbtnimg {
  filter: brightness(1.15);
}

.sbiinfbtn:hover .infbtnimg,
.sbiinfbtn:focus .infbtnimg {
  filter: initial;
}

.infbtntt,
.sbiinfbtn.hdtip:focus .infbtntt {
  display: none;
}

.sbiinfbtn:hover .infbtntt,
.sbiinfbtn.hdtip:hover .infbtntt,
.sbiinfbtn:focus .infbtntt,
.sbiinfbtn:focus-within .infbtntt {
  display: block;
}

.infbtntt {
  display: none;
  text-align: left;
  color: #444;
  position: absolute;
  padding: 12px;
  width: 175px;
  right: -42px;
  background: #fff;
  z-index: 1;
  top: 24px;
  margin: 0;
  border-radius: 4px;
  -moz-box-shadow: 0 0 0 1px rgba(0,0,0,.05),0 4px 12px 1px rgba(0,0,0,.14);
  -webkit-box-shadow: 0 0 0 1px rgba(0,0,0,.05),0 4px 12px 1px rgba(0,0,0,.14);
  box-shadow: 0 0 0 1px rgba(0,0,0,.05),0 4px 12px 1px rgba(0,0,0,.14);
  font-family: 'Segoe UI',Arial,Helvetica,Sans-Serif;
  font-size: 13px;
  line-height: 20px;
}

.sbiinflnks {
  margin: 12px 0 4px;
}

.sbiinflnk {
  font-size: 11px;
  line-height: 14px;
  color: #00809d;
}

.sbiinfsep {
  margin: 0 8px;
}

.infbtntt:before {
  content: '';
  border: 1px solid #ddd;
  display: block;
  width: 7px;
  height: 7px;
  transform: rotate(45deg);
  background: #fff;
  position: absolute;
  border-bottom: none;
  border-right: none;
  right: 45px;
  top: -4px;
}

#vsk_sbiinfbtn.sbiinfbtn {
  position: absolute;
  top: -14px;
  right: 16px;
  display: block;
}

#vsk_sbiinfbtn.sbiinfbtn .infbtntt {
  right: -6px;
}

#vsk_sbiinfbtn.sbiinfbtn .infbtntt:before {
  right: 10px;
}
